DROP TABLE listing;

CREATE TABLE `listing` (
  `ID` int(10) unsigned NOT NULL auto_increment,
  `RunDate` varchar(50) default NULL,
  `PubCode` varchar(64) default NULL,
  `AdType` varchar(32) default NULL,
  `CatCode` varchar(32) default NULL,
  `ClassCode` varchar(32) default NULL,
  `SubclassCode` varchar(64) default NULL,
  `PositionDescription` varchar(64) default NULL,
  `Subclass3` varchar(64) default NULL,
  `Subclass4` varchar(64) default NULL,
  `AdNumber` varchar(32) default NULL,
  `StartDate` varchar(50) default NULL,
  `EndDate` varchar(50) default NULL,
  `LineCount` smallint(5) unsigned default NULL,
  `RunCount` tinyint(3) unsigned default NULL,
  `CustomerType` varchar(32) default NULL,
  `AccountNumber` varchar(32) default NULL,
  `AccountName` varchar(64) default NULL,
  `Addr1` text,
  `Addr2` text,
  `BlockHouseNumber` text,
  `UnitNumber` text,
  `FloorNumber` text,
  `POBoxNumber` text,
  `AttentionTo` text,
  `City` varchar(64) default NULL,
  `State` char(2) default NULL,
  `PostalCode` varchar(10) default '00000-0000',
  `Country` varchar(64) default NULL,
  `PhoneNumber` varchar(16) default NULL,
  `FaxNumber` varchar(16) default NULL,
  `URLAddr` varchar(256) default NULL,
  `EmailAddr` varchar(256) default NULL,
  `PayFlag` enum('Y','N') default NULL,
  `AdDescription` text,
  `OrderSource` text,
  `OrderStatus` varchar(32) default NULL,
  `PayorAcct` varchar(32) default NULL,
  `AgencyFlag` enum('Y','N') default NULL,
  `RateNote` text,
  `UserDate1Label` varchar(50) default NULL,
  `UserDate2Label` varchar(50) default NULL,
  `UserDate3Label` varchar(50) default NULL,
  `UserDate4Label` varchar(50) default '0000-00-00',
  `AdContent` text,
  PRIMARY KEY  (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=71 DEFAULT CHARSET=utf8;




DROP TABLE siteinfo;

CREATE TABLE `siteinfo` (
  `ID` int(10) unsigned NOT NULL auto_increment,
  `PubCode` varchar(64) NOT NULL,
  `CoBrandURL` varchar(256) NOT NULL,
  PRIMARY KEY  (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




